import React, { useState } from 'react';
import {css} from 'emotion'
import Modal from 'react-responsive-modal';
import cabeca from '../cabeca.png'


const [MyModal, setMyModal] = useState(false)

function University() {
    return (
        <div>
            <img onClick={() => setMyModal(true)} className={styles.head} src={cabeca} alt="Patricia's Face"/>
            <Modal open={open} onClick={() => setMyModal(false)} little>
          <h2>Simple centered modal</h2>
        </Modal>
        </div>
    )
}
export default University;

const styles = {
    head: css `
        cursor: pointer;
    `
}
